import { Component } from '@angular/core';
import { CredencialesService } from '../credenciales.service';

@Component({
  selector: 'app-credenciales',
  templateUrl: './credenciales.component.html',
  styleUrls: ['./credenciales.component.css']
})
export class CredencialesComponent {
  key: string = '';
  sharedSecret: string = '';

  constructor(private credencialesService: CredencialesService) {}

  enviarDatos() {
    this.credencialesService.enviarCredenciales(this.key, this.sharedSecret)
      .subscribe(
        response => {
          console.log('Credenciales enviadas correctamente');
        },
        error => {
          console.error('Error al enviar credenciales', error);
        }
      );
  }
}
<div>
    <h2>Enviar Credenciales</h2>
    <form (submit)="enviarDatos()">
      <div>
        <label for="key">Key:</label>
        <input id="key" [(ngModel)]="key" name="key" required />
      </div>
      <div>
        <label for="sharedSecret">Shared Secret:</label>
        <input id="sharedSecret" [(ngModel)]="sharedSecret" name="sharedSecret" required />
      </div>
      <button type="submit">Enviar</button>
    </form>
  </div>
